import React from 'react';

const Header = () => {
  return (
    <header>
      <figure><img src="" alt="" /></figure>
      <nav>
      <ul>
        <li><a href="">canciones</a></li>
        <li><a href="">acordes</a></li>
      </ul>
      </nav> 
      <div>
        <input type='text' placeholder="buscar" />
        <input type="submit" />
      </div>
    </header>
  );
};

export default Header;
